ts/spring-batch/labels/in:%20core', 'name': 'in: core', 'color': '008672', 'default': False, 'description': None}], 'state': 'closed', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': {'url': 'https://api.github.com/repos/spring-projects/spring-batch/milestones/118', 'html_url': 'https://github.com/spring-projects/spring-batch/milestone/118', 'labels_url': 'https://api.github.com/repos/spring-projects/spring-batch/milestones/118/labels', 'id': 6052858, 'node_id': 'MDk6TWlsZXN0b25lNjA1Mjg1OA==', 'number': 118, 'title': '5.0.0-M1', 'description': '', 'creator': {'login': 'benas', 'id': 1210553, 'node_id': 'MDQ6VXNlcjEyMTA1NTM=', 'avatar_url': 'https://avatars.githubusercontent.com/u/1210553?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/benas', 'html_url': 'https://github.com/benas', 'followers_url': 'https://api.github.com/users/benas/followers', 'following_url': 'https://api.github.com/users/benas/following{/other_user}', 'gists_url': 'https://api.github.com/users/benas/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/benas/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/benas/subscriptions', 'organizations_url': 'https://api.github.com/users/benas/orgs', 'repos_url': 'https://api.github.com/users/benas/repos', 'events_url': 'https://api.github.com/users/benas/events{/privacy}', 'received_events_url': 'https://api.github.com/users/benas/received_events', 'type': 'User', 'site_admin': False}, 'open_issues': 0, 'closed_issues': 62, 'state': 'closed', 'created_at': '2020-10-30T18:59:00Z', 'updated_at': '2022-02-22T12:57:14Z', 'due_on': '2022-01-19T08:00:00Z', 'closed_at': '2022-01-19T14:41:47Z'}, 'comments': 5, 'created_at': '2021-12-11T17:44:48Z', 'updated_at': '2022-04-07T11:15:00Z', 'closed_at': '2022-01-19T14:32:55Z', 'author_association': 'NONE', 'active_lock_reason': None, 'body': 'I want to use `Map.of()` in my execution context (primarily for tests). But this gives an error:
```java
val serializer = new Jackson2ExecutionContextStringSerializer();
val out = new ByteArrayOutputStream();
serializer.serialize(Map.of("f", Map.of("f1", "v1")), out);
val json = out.toString();
System.out.println(json);
serializer.deserialize(new ByteArrayInputStream(json.getBytes()));
```
Output:
```java
{"f":{"@class":"java.util.ImmutableCollections$Map1","f1":"v1"}}
Exception in thread "main" com.fasterxml.jackson.databind.exc.InvalidTypeIdException: Could not resolve subtype of [map type; class java.util.HashMap, [simple type, class java.lang.String] -> [simple type, class java.lang.Object]]: missing type id property '@class'
```

The problem is that the typing inside `Jackson2ExecutionContextStringSerializer` is configured to `ObjectMapper.DefaultTyping.NON_FINAL` which skips the addition of `@class` property to the root object for some reason, even though `ImmutableCollections$Map1` is `final`. So, as you can see, only the inner map has it. But if we try to serialize `new HashMap<>(Map.of("f", Map.of("f1", "v1")))` then it does include it for the root. 
One solution to it is to use `ObjectMapper.DefaultTyping.EVERYTHING` or enable `MapperFeature.USE_BASE_TYPE_AS_DEFAULT_IMPL` so that the `ObjectMapper` doesn't need to check against `@class` property if it's given the type at compile time. 

It knows that it's supposed to be a `HashMap` from `Jackson2ExecutionContextStringSerializer#deserialize`:
```java
public Map<String, Object> deserialize(InputStream in) throws IOException {
    TypeReference<HashMap<String,Object>> typeRef = new TypeReference<HashMap<String,Object>>() {};
    return objectMapper.readValue(in, typeRef);
}
```

So, with enabling the feature, another error comes out:
```java
val serializer = new Jackson2ExecutionContextStringSerializer();
((ObjectMapper) FieldUtils.readField(serializer, "objectMapper", true))
        .enable(MapperFeature.USE_BASE_TYPE_AS_DEFAULT_IMPL);
val out = new ByteArrayOutputStream();
serializer.serialize(Map.of("f", Map.of("f1", "v1")), out);
val json = out.toString();
System.out.println(json);
serializer.deserialize(new ByteArrayInputStream(json.getBytes()));
```

The output:
```java
{"f":{"@class":"java.util.ImmutableCollections$Map1","f1":"v1"}}
Exception in thread "main" com.fasterxml.jackson.databind.JsonMappingException: The class with java.util.ImmutableCollections$Map1 and name of java.util.ImmutableCollections$Map1 is not trusted. If you believe this class is safe to deserialize, you can add it to the base set of trusted classes at construction time or provide an explicit mapping using Jackson annotations or a custom ObjectMapper. If the serialization is only done by a trusted source, you can also enable default typing. (through reference chain: java.util.HashMap["f"])
```

I think all `java.util.ImmutableCollections$*` should be enabled by default. 

With adding those, another error comes out:
```java
  val serializer = new Jackson2ExecutionContextStringSerializer(
          "java.util.ImmutableCollections$ListN",
          "java.util.ImmutableCollections$List12",
          "java.util.ImmutableCollections$SubList",
          "java.util.ImmutableCollections$Set12",
          "java.util.ImmutableCollections$SetN",
          "java.util.ImmutableCollections$Map1",
          "java.util.ImmutableCollections$MapN"
  );
  ((ObjectMapper) FieldUtils.readField(serializer, "objectMapper", true))
          .enable(MapperFeature.USE_BASE_TYPE_AS_DEFAULT_IMPL);
  val out = new ByteArrayOutputStream();
  serializer.serialize(Map.of("f", Map.of("f1", "v1")), out);
  val json = out.toString();
  System.out.println(json);
  val res = serializer.deserialize(new ByteArrayInputStream(json.getBytes()));
  System.out.println(res);
```

The output:
```java
{"f":{"@class":"java.util.ImmutableCollections$Map1","f1":"v1"}}
Exception in thread "main" com.fasterxml.jackson.databind.exc.InvalidDefinitionException: Cannot construct instance of `java.util.ImmutableCollections$Map1` (no Creators, like default constructor, exist): no default constructor found
```

That's a Jackson issue https://github.com/FasterXML/jackson-databind/issues/2900 that's already been fixed in `2.13.0`. So, after updating the Jackson library to `2.13.0` the last code snippet gives the correct output:
```java
{"f":{"@class":"java.util.ImmutableCollections$Map1","f1":"v1"}}
{f={f1=v1}}
```

**Environment**
Spring Batch 4.3.3
Spring Boot 2.5.0
JDK Amazon Corretto 11.0.13', 'reactions': {'url': 'https://api.github.com/repos/spring-projects/spring-batch/issues/4036/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/spring-projects/spring-batch/issues/4036/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/spring-projects/spring-batch/issues/comments/1091608066', 'html_url': 'https://github.com/spring-projects/spring-batch/issues/4036#issuecomment-1091608066', 'issue_url': 'https://api.github.com/repos/spring-projects/spring-batch/issues/4036', 'id': 1091608066, 'node_id': 'IC_kwDOABCefc5BEJ4C', 'user': {'login': 'benas', 'id': 1210553, 'node_id': 'MDQ6VXNlcjEyMTA1NTM=', 'avatar_url': 'https://avatars.githubusercontent.com/u/1210553?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/benas', 'html_url': 'https://github.com/benas', 'followers_url': 'https://api.github.com/users/benas/followers', 'following_url': 'https://api.github.com/users/benas/following{/other_user}', 'gists_url': 'https://api.github.com/users/benas/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/benas/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/benas/subscriptions', 'organizations_url': 'https://api.github.com/users/benas/orgs', 'repos_url': 'https://api.github.com/users/benas/repos', 'events_url': 'https://api.github.com/users/benas/events{/privacy}', 'received_events_url': 'https://api.github.com/users/benas/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-04-07T11:15:00Z', 'updated_at': '2022-04-07T11:15:00Z', 'author_association': 'CONTRIBUTOR', 'body': '> I think Spring Batch should allow me to choose for myself on this one.

Spring Batch provides a setter of the object mapper in order to use your custom one. I'm not sure I understand why you need reflection to set it on the serializer. The following should cover the 3 points you mentioned:

```java
@Bean
@SneakyThrows
public ExecutionContextSerializer customSerializer() {
    Jackson2ExecutionContextStringSerializer serializer = new Jackson2ExecutionContextStringSerializer(
            "java.util.ImmutableCollections$ListN",
            "java.util.ImmutableCollections$List12",
            "java.util.ImmutableCollections$SubList",
            "java.util.ImmutableCollections$Set12",
            "java.util.ImmutableCollections$SetN",
            "java.util.ImmutableCollections$Map1",
            "java.util.ImmutableCollections$MapN",
            "my.Clazz"
    );
    ObjectMapper objectMapper = new ObjectMapper()
        .enable(MapperFeature.USE_BASE_TYPE_AS_DEFAULT_IMPL)
        .findAndRegisterModules();
    serializer.setObjectMapper(objectMapper);
    return serializer;
}
```
