What you can do is create the sequences and register the new incrementer (which is based on sequences) through the job repository factory bean, something like:

```
@Bean
public BatchConfigurer batchConfigurer(DataSource dataSource) {
	return new DefaultBatchConfigurer(dataSource) {
		@Override
		protected JobRepository createJobRepository() throws Exception {
			JobRepositoryFactoryBean factoryBean = new JobRepositoryFactoryBean();
			factoryBean.setIncrementerFactory(new DefaultDataFieldMaxValueIncrementerFactory(dataSource) {
				@Override
				public DataFieldMaxValueIncrementer getIncrementer(String incrementerType, String incrementerName) {
					return new SqlServerSequenceMaxValueIncrementer(dataSource, incrementerName);
				}
			});
			// set other properties on the factory bean
			factoryBean.afterPropertiesSet();
			return factoryBean.getObject();
		}
	};
}
```

This should work in a similar way to what is described here: https://github.com/spring-projects/spring-framework/issues/21425#issuecomment-453472597.

I'm closing this issue for now, but do not hesitate to add a comment if you need further support on this.", 'reactions': {'url': 'https://api.github.com/repos/spring-projects/spring-batch/issues/comments/1090035073/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

