id': 'MDU6TGFiZWwxNzM4MDQ5OTYy', 'url': 'https://api.github.com/repos/spring-projects/spring-batch/labels/type:%20bug', 'name': 'type: bug', 'color': 'd93f0b', 'default': False, 'description': ''}], 'state': 'closed', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 2, 'created_at': '2022-02-06T17:07:02Z', 'updated_at': '2022-03-24T09:49:22Z', 'closed_at': '2022-03-24T09:49:22Z', 'author_association': 'NONE', 'active_lock_reason': None, 'body': '**Bug description**
The property `spring.batch.job.names` does not run the jobs in the order of the jobs listed.

I expected the comma-separated values would maintained order, but they do not. The documentation does not state whether the property should maintain order or not.  
https://docs.spring.io/spring-boot/docs/current/reference/html/howto.html#howto.batch.running-jobs-on-startup

The property: `--spring.batch.job.names=JOB_1,JOB_2` runs the jobs in any order:
```
JOB_1 --> JOB_2
or
JOB_2 --> JOB_1
```

**Environment**
- Spring: 4.3.4
- Java: 1.8.0_261
- Maven: 3.6.3

**Steps to reproduce**
1. Create a Spring Batch application with at least 2 jobs.
2. Run the application with `--spring.batch.job.names=JOB_1,JOB_2`

**Expected behavior**
The application ALWAYS runs JOB_1, followed by JOB_2.

**Actual behavior**
The application runs the jobs in unpredictable order. Sometimes JOB_1 runs first, sometimes JOB_2 runs first.

The appears to be due to the fact that Spring locates the Job Beans from the `HashMap` of all Beans. The `HashMap` is unordered and can locate and return the Job Beans in any order.

**Minimal Complete Reproducible example**

1. Copy `pom.xml` and `BatchProcessingApplication.java` shown below.
2. Run `mvn clean package`
3. Run `java -jar target/springbatch-bug-1.0-SNAPSHOT.jar --spring.batch.job.names=jobB,jobA`
4. The logs show `jobA` is ran before `jobB`.
```
